                          |\r\n      | Verify  age field with Stepper controls (up\/down arrows) in dialog    | User should see Age input field to have stepper controls                                |\r\n      | Verify  weight field with Stepper controls (up\/down arrows) in dialog | User should see weight input field to have stepper controls                             |\r\n      | Verify the presence of checkbox                                       | User should see check box for Family history of diabetes field                          |\r\n      | Verify the placeholder text for Age field                             | User should be able to view the placeholder \"Enter your age (1-150)\" in the age field   |\r\n      | Verify the placeholder text for weight                                | User should see \"Enter your weight in kg (1-999)\"                                       |\r\n      | Verify the dropdown for Physical Activity Level                       | User should see  dropdown for Physical Activity Level                                   |\r\n      | Verify the dropdown for Blood Pressure                                | User should see dropdown for Blood Pressure                                             |\r\n      | Verify the dropdown for Diet Quality                                  | User should see dropdown for Diet Quality                                               |\r\n      | Verify the presence of initial value for Physical Activity Level      | Physical Activity - Level User should see \"Select activity level\" as the default option |\r\n      | Verify the presence of initial value dropdown for Blood Pressure      | Blood Pressure - User should see \"Select blood pressure status\" as the default option   |\r\n      | Verify the presence of initial value dropdown for Diet Quality        | Diet Quality - User should see \"Select diet quality\" as the default option              |\r\n@Neha\r\n  Scenario Outline: Verify the values for Physical Activity Level\r\n    Given User is on SweetBalance homepage\r\n    When User clicks Check Your Risk button\r\n    Then User should see the following options in the activity level dropdown:\r\n      | Select activity level                |\r\n      | Active (Exercise 3+ times a week)    |\r\n      | Moderate (Exercise 1-2 times a week) |\r\n      | Sedentary (Rarely exercise)          |\r\n@Neha\r\n  Scenario Outline: Verify the values for Blood Pressure\r\n    Given User is on SweetBalance homepage\r\n    When User clicks Check Your Risk button\r\n    Then User should see the following options in the Blood Pressure dropdown:\r\n      | Select blood pressure status |\r\n      | Normal                       |\r\n      | Elevated                     |\r\n      | High                         |\r\n@Neha\r\n  Scenario Outline: Verify the values for Diet Quality\r\n    Given User is on SweetBalance homepage\r\n    When User clicks Check Your Risk button\r\n    Then User should see the following options in the Diet Quality dropdown:\r\n      | Select diet quality                             |\r\n      | Excellent (Balanced, mostly whole foods)        |\r\n      | Average (Mixed whole foods and processed foods) |\r\n      | Poor (Mostly processed foods, high sugar)       |\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/DiabetesRiskAnalyzer.feature","feature":{"location":{"line":3,"column":1},"tags":[{"location":{"line":2,"column":1},"name":"@Neha","id":"02b6b79f-ba36-4289-81e8-8b56e71ea6ac"}],"language":"en","keyword":"Feature","name":"Verification on Diabetes Risk Analyzer","description":"","children":[{"scenario":{"location":{"line":6,"column":3},"tags":[{"location":{"line":5,"column":3},"name":"@Neha","id":"03954e50-d86e-461f-9f82-b6cc76d9fc00"}],"keyword":"Scenario Outline","name":"Verify <scenario>","description":"","steps":[{" ces\/features\/DiabetesRiskAnalyzer_Functional.feature","name":"Verify valid values in all field  dialog  form","language":"en","steps":[{"astNodeIds":["11b1a844-acca-48ea-b4a4-e62536a0e4a5"],"id":"45f46f49-7712-4390-9058-873c23d69a07","type":"Action","text":"User clicks Check Your Risk button"},{"astNodeIds":["71e86dd6-4052-4d37-8bb6-08def9b1a278","ba22ac60-a857-4345-a5ff-426e40a8db31"],"id":"1c283037-ae21-4d32-98d6-45ffbc992ee1","type":"Context","text":"User is in diabetes risk analyzer"},{"astNodeIds":["ec1657b3-517a-4f96-ae6f-717728c7ce44","ba22ac60-a857-4345-a5ff-426e40a8db31"],"id":"f21d79bc-54cd-4a3d-b88a-bf7ed88076d4","type":"Action","text":"User enters values in all fields from \"launch\" and \"launch_01\""},{"astNodeIds":["069b9695-faa5-4f43-8df3-0b5056e2cd88","ba22ac60-a857-4345-a5ff-426e40a8db31"],"id":"d068dae1-b70a-462f-8cca-16a81efc4676","type":"Action","text":"User clicks Calculate Risk button after entering valid values in all fields"},{"astNodeIds":["6ca4fb9a-3dd7-4ecc-bbe5-9f2120200bf3","ba22ac60-a857-4345-a5ff-426e40a8db31"],"id":"a966fa2a-0e03-415a-a9ca-82b115d9c7d8","type":"Outcome","text":"User should see \"Your Diabetes Risk Assessment\" dialog box"}],"tags":[{"name":"@Neha","astNodeId":"fab304f8-3a7b-437d-8872-d2c7de233e27"},{"name":"@Neha","astNodeId":"d203f292-327b-430c-888d-5cba1bdc9640"}],"astNodeIds":["69fa2d09-586c-4eec-ad67-78e4f833f695","ba22ac60-a857-4345-a5ff-426e40a8db31"]}},{"source":{"uri":"file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/FreeDashboard.feature","data":"@sweet @FreeDashboard\r\n\r\nFeature: Dashboard page validation for Registered Free account user\r\n\r\nBackground: User is in First page \r\nGiven User is on login page\r\nWhen Registered user clicks sign in after entering password\r\n\r\n@WelcomeMessage \r\nScenario: Verify the Welcome Message is displayed with name\r\nGiven User is landed on free page\r\nWhen User clicks the Dashboard on the navigation bar\r\nThen User should see the Welcome Back,full name message\r\n\r\n@DashboardDispalyed\r\nScenario Outline: Verify \"<Scenario>\" the presence of dashboard \r\nGiven User is landed on free page\r\nWhen User clicks the Dashboard on the navigation bar\r\nThen The \"<Scenario>\" should be displayed\r\n\r\nExamples:\r\n  | Scenario |\r\n  | Displayed Message |\r\n  | Upgrade Premium |\r\n  | Account Information |\r\n  | Save Changes |\r\n  | Account Information All Fields |\r\n  \r\n@DashboardAge\r\nScenario: Verify age should accept only Numeric Value\r\nGiven User is in FreeDashboard Page \r\nWhen User edit age field with valid data\r\nThen User should see that entered age is displayed in that field\r\n\r\n@DashboardHeight\r\nScenario: Verify height should accept only Numeric Value\r\nGiven User is in FreeDashboard Page  \r\nWhen User edit height field with valid data\r\nThen User should see that entered height is displayed in height field\r\n\r\n@DashboardWeight\r\nScenario: Verify Weight should accept only Numeric Value\r\nGiven User is in FreeDashboard Page \r\nWhen User edit weight field with valid data\r\nThen User should see that entered weight is displayed in weight field\r\n\r\n@DashboardWeight\r\nScenario: Verify Exercise Routine Level dropdown is displayed with options\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks the dropdown of Exercise Routine Level\r\nThen User should see the dropdown with options Easy,Medium,Hard\r\n\r\n@DashboardCuisinePreferences\r\nScenario: Verify Cuisine Preferences dropdown is displayed with options\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks the dropdown of Cuisine Preferences\r\nThen User should see the dropdown with list of cuisine types Indian,American,Continental,Mediterranean,Asian,Middle Eastern,Mexican\r\n\r\n@DashboardFoodAllergies\r\nScenario: Verify Food Allergies dropdown is displayed with options\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks the dropdown of Food Allergies\t\r\nThen User should see the dropdown list of common allergy options None,Dairy,Gluten,Shellfish,Soy,Eggs,Nuts,Other\r\n\r\n@DashboardStressManagement\r\nScenario: Verify the header Stress Management Techniques\r\nGiven User is in FreeDashboard Page \r\nWhen User scrolls to the Stress Management section\r\nThen User should see the Title Stress Management Techniques\r\n\r\n@DashboardNavigationBar\r\nScenario: Verify the navigation bar order \r\nGiven User is in FreeDashboard Page \r\nWhen User scrolls to the navigation bar section\r\nThen user should see tabs Meditation, Breathing, Movement and Mindfulness\r\n\r\n@DashboardGuidedMeditation\r\nScenario: Verify Guided Meditation section is visible\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks Meditation tab\r\nThen User should see the content with title Guided Meditation\r\n\r\n@DashboardMeditationDurationButtons\r\nScenario: Verify meditation duration options are displayed\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks Meditation tab\r\nThen User should see buttons for 5 min, 10 min, and 15 min\r\n\r\n@DashboardAudioIndicator\r\nScenario: Verify audio player progress bar and time indicators\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks Meditation tab\r\nThen User should see a progress bar with time indicators 0:00 and 5:00 by default\r\n\r\n@DashboardAudioPlayback\r\nScenario: Verify audio playback functionality\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks audio play button \r\nThen User Should see meditation audio should start playing and the progress bar should update accordingly\r\n\r\n@DashboardGentleMovement\r\nScenario: Verify the Title displayed under Movement tab\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks Movement Tab\r\nThen User should see title Gentle Movement\r\n\r\n@DashboardMovementDescription\r\nScenario: Verify the content displayed under Movement tab\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks Movement Tab\r\nThen User should see the description simple stretches to release tension: with the bullet points, Neck rolls - 5 times each direction, Shoulder circles - 10 times, Wrist and ankle rotations, Gentle torso twists\r\n  \r\n  \r\n@DashboardMindfulness\r\nScenario: Verify the title under Mindfulness tab\r\nGiven User is in FreeDashboard Page \r\nWhen  User clicks Mindfulness tab\r\nThen User should see title Present Moment Awareness\r\n\r\n@DashboardMindfulnessDescription\r\nScenario: Verify the content displayed under Mindfulness tab\r\nGiven User is in FreeDashboard Page \r\nWhen  User clicks Mindfulness tab\r\nThen User should see the description Focus on your senses:with the bullet points, Notice 5 things you can see,Listen for 3 different sounds,Find 2 things you can smell,Observe 1 thing you can taste\r\n\r\n@DashboardDiabetesManagementSection\r\nScenario: Verify Benefits for Diabetes Management section is visible\r\nGiven User is in FreeDashboard Page \r\nWhen User scroll to the end \r\nThen User should see the list of benefits Reduces Stress Hormones, with explanation Lowers cortisol that can increase blood glucose,Improves Sleep, with explanation Better sleep leads to better glucose control,Reduces Diabetes Distress with explanation Helps manage overwhelm from diabetes care\r\n   \r\n@DashboardBreathingDescription\r\nScenario: Verify heading and description is displayed under Breathing tab\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks breathing tab under stress management techniques\r\nThen User should see the heading 4-7-8 Breathing Technique  with the description A natural tranquilizer for the nervous system\r\n\r\n@DashboardBreathingTab\r\nScenario: Verify Start button is displayed under Breathing tab\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks breathing tab under stress management techniques\r\nThen User should see the Start Breathing Exercise button\r\n\r\n\r\n@DashboardCycleCompleted\r\nScenario: Verify Cycle completed counter is displayed\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks breathing tab under stress management techniques\r\nThen User should see the Cycles completed counter text and value starting at 0\r\n\r\n@DashboardCurrentPhase\r\nScenario: Verify current phase counter is displayed\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks breathing tab under stress management techniques\r\nThen User should see the label Current phase with a hyphen (-) as its current value.\r\n\r\n@DashboardBreathingSteps\r\nScenario: verify breathing steps are displayed\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks breathing tab under stress management techniques\r\nThen User should see the steps Inhale 4 seconds, Hold 7 seconds, Exhale 8 seconds\r\n\r\n@DashboardBreathinStartButton\r\nScenario: Verify start button functionality\r\nGiven User is in FreeDashboard Page \r\nWhen User clicks the Start Breathing Exercise button during the breathing exercise\r\nThen User should see the breathing cycles begin \r\n\r\n\r\n\r\n\r\n\r\n\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/FreeDashboard.feature","feature":{"location":{"line":3,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@sweet","id":"22266104-696c-493e-a4fc-704cfe94ba99"},{"location":{"line":1,"column":8},"name":"@FreeDashboard","id":"ae2fbf12-dcdc-4b18-bfdb-56867585f296"}],"language":"en","keyword":"Feature","name":"Dashboard page validation for Registered Free account user","description":"","children":[{"background":{"location":{"line":5,"column":1},"keyword":"Background","name":"User is in First page","description":"","steps":[{"location":{"line":6,"column":1},"keyword":"Given ","keywordType":"Context","text":"User is on login page","id":"2e1bfa0e-2511-4faa-8b3e-e740cd8110e9"},{"location":{"line":7,"column":1},"keyword":"When ","keywordType":"Action","text": es\/HomePageFreeUser.feature","data":"@sweet @FreeUser @HomePageFreeUser\r\nFeature: Home Page Validation for Registered Free Account User\r\n\r\nBackground: User is in First page \r\nGiven User is on login page\r\nWhen Registered user clicks sign in after entering password\r\n \r\n@HomePageTextNavigation @HPFreeUser\r\nScenario: Verify order of text in navigation bar\r\nGiven User is landed on free page\r\nWhen User clicks meal section from FreeUser\r\nThen User should see the navigation bar displaying items in the order: \"Home\", \"Dashboard\", \"Education\"\r\n\r\n@HomePageToggle @ToggleIcon\r\nScenario: Verify the presence of collapse toggle \r\nGiven User is landed on free page\r\nWhen User clicks meal section from FreeUser\r\nThen User should see a caret toggle icon next to the Today's Meal Plan title\r\n \r\n@HomePageNutrientInsights @MealNutrientInsights\r\nScenario: Verify the presence of Nutrition Insights heading is shown for each meal\r\nGiven User is landed on free page\r\nWhen User clicks meal section from FreeUser\r\nThen User should see Nutrition Insights heading for each of the meal section \r\n\r\n@HomePageNutrientBar @HorizontalBar\r\nScenario: Verify nutrition bar is shown for each meal\r\nGiven User is landed on free page\r\nWhen User clicks meal section from FreeUser\r\nThen User should see horizontal bar for Carbs, Protein, and Fat\r\n\r\n@HomePageNutrientValue \r\nScenario Outline: Verify \"<Scenario>\" the presence of Carbs,Protein and Fat in Meals Section\r\nGiven User is landed on free page\r\nWhen User clicks meal section from FreeUser\r\nThen The \"<Scenario>\" value should be displayed HomePageNutrientValue\r\n\r\nExamples:\r\n  | Scenario |\r\n  #| Pre-Meal |\r\n  #| Carbs   |\r\n  #| Protein |\r\n  #| Fat     |\r\n#\t| Meal Time |\r\n#\t| Snacks PM |\r\n#\t| hh:mm Time |\r\n\t| snack Three Clock |\r\n#\t| Dot Indicator |\r\n#\t|View Full Plan |\r\n\r\n@HomePageExcercise @ExcercisePlan\r\nScenario Outline: Verify \"<Scenario>\" in the Home page Exercise section\r\nGiven User is landed on free page\r\nWhen User clicks exercise section from HomePage\r\nThen The \"<Scenario>\" in Home page Excercise should be displayed\r\n\r\nExamples:\r\n  | Scenario |\r\n  | Exercise Section | \r\n  | Two Exercise List |  \r\n  | Time In Each Exercise  |\r\n  | Title in Each ExercisePlan  | \r\n  | MorningExercise Time |\r\n  | EveningExercise Time  |\r\n  | Time Format  | \r\n  | Time Duration  | \r\n  | Time Duration Format |\r\n  | Dot Indicator|\r\n  | Intensity Level |\r\n  |View Full Schedule |\r\n  |View Full Schedule Subscription|\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/HomePageFreeUser.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@sweet","id":"abe02485-8432-40f2-bdc9-d991d77ce74d"},{"location":{"line":1,"column":8},"name":"@FreeUser","id":"d73093f9-96f0-47ad-b7bb-d6c465ed5094"},{"location":{"line":1,"column":18},"name":"@HomePageFreeUser","id":"ff038abb-2cc8-4ab5-a8fd-6c8fb1d250c1"}],"language":"en","keyword":"Feature","name":"Home Page Validation for Registered Free Account User","description":"","children":[{"background":{"location":{"line":4,"column":1},"keyword":"Background","name":"User is in First page","description":"","steps":[{"location":{"line":5,"column":1},"keyword":"Given ","keywordType":"Context","text":"User is on login page","id":"33303c79-6062-4287-852c-b6d234f17687"},{"location":{"line":6,"column":1},"keyword":"When ","keywordType":"Action","text":"Registered user clicks sign in after entering password","id":"d5ccd87e-807a-41eb-bb51-598b6b7fee07"}],"id":"cc4f6a76-92a5-45e3-b628-801962a550ab"}},{"scenario":{"location":{"line":9,"column":1},"tags":[{"location":{"line":8,"column":1},"name":"@HomePageTextNavigati ge\r\n  #Given User launches the browser\r\n  #When User enters the SweetBalance url\r\n  #Then User should see app name on the top left \"SweetBalance\"\r\n  \r\n  @launchPage\r\n  Scenario Outline: Verify <Scenario>\r\n    Given User launches the browser\r\n    When User enters the SweetBalance url\r\n    Then User should see <Expected>\r\n\r\n    Examples: \r\n      | Scenario                                                                                    | Expected                                                                                                                                                           |  |\r\n      | Validate the presence of App Name on the home page                                          | SweetBalance                                                                                                                                                       |  |\r\n      | presence of policy details                                                                  | Our Terms of Service and Privacy Policy have recently been updated                                                                                                 |  |\r\n      | Verify the homepage heading is visible                                                      | Smart Diabetes Tracking Powered by AI                                                                                                                              |  |\r\n      | Verify the Start Today input button is visible                                              | User should see a Start Today input button                                                                                                                         |  |\r\n      | Verify the diabetes management tools section is visible                                     | User should see the text \"Comprehensive Diabetes Management Tools\"                                                                                                 |  |\r\n      | Verify the Health Tracking card is visible                                                  | User should see a first card with title \"Health Tracking\"                                                                                                          |  |\r\n      | Verify the Nutrition & Exercise card is visible                                             | User should see a second card with title \"Nutrition & Exercise\"                                                                                                    |  |\r\n      | Verify the Smart Insights card is visible                                                   | User should see a third card with title \"Smart Insights\"                                                                                                           |  |\r\n      | Validate description in Health Tracking feature card                                        | User should see text1 Monitor glucose levels, medication, and vital statistics, Easy logging of daily readings,Visualize trends over time,Set personalized targets |  |\r\n      | Validate description in Nutrition & Exercise card                                           | User should see the text  \"Carb counting tools,Customized exercise plans,Meal suggestions based on readings\"                                                       |  |\r\n      | Validate description in Smart Insights card                                                 | User should see the smartInsights text  \"Pattern detection algorithms,Early warning notifications,Actionable recommendations\"                                      |  |\r\n      | Validate icon in Health tracking feature card                                               | User should see heart icon                                                                                                                                         |  |\r\n      | Validate icon in Nutrition & Exercise card                                                  | User should see activity inside square icon                                                                                                                        |  |\r\n      | Validate icon in Smart Insights card                                                        | User should see clock icon                                                                                                                                         |  |\r\n      | Verify testimonial from James D. is visible                                                 | User should see a testimonial from user \"James D.\"                                                                                                                 |  |\r\n      | Verify testimonial from Maria L. is visible                                                 | User should see a secon testimonial from user \"Maria L.\"                                                                                                           |  |\r\n      | Verify testimonial from Robert T. is visible                                                | User should see a third testimonial from user \"Robert T.\"                                                                                                          |  |\r\n      | Validate Join our community of successful members text is visible above testimonial section | User should see \"Join our community of successful members\" text is visible above testimonial section                                                               |  |\r\n      | Validate presence of yellow stars above Join our community of successful members text       | User should see 5 yellow stars above Join our community of successful members text                                                                                 |  |\r\n      | Validate rating for James D testimonial                                                     | User should see 5 stars under first tetsimonial of James D.                                                                                                        |  |\r\n      | Validate rating for Maria L testimonial                                                     | User should see 5 stars under second tetsimonial of Maria L.                                                                                                       |  |\r\n      | Validate rating for Robert T testimonial                                                    | User should see 5 stars under third tetsimonial of Robert T                                                                                                        |  |\r\n      | Validate presence of bottom section heading in home page                                    | User should see a section with heading \"Take control of your diabetes today\"                                                                                       |  |\r\n      | Validate the presence of button Check your Risk                                             | User should see a button labeled \"Check Your Risk\"                                                                                                                 |  |\r\n\r\n #Feature: Verify Homepage navigation components\r\n  @launchPage\r\n  Scenario: Verify redirection from Start Today button\r\n    Given User is on SweetBalance homepage\r\n    When User click the Start Today button\r\n    Then User should be redirected to the Login page\r\n\r\n  @launchPage\r\n  Scenario: Validate Login link visibility\r\n    Given User is on SweetBalance homepage\r\n    When User look at the top right corner\r\n    Then User  should see a link labeled \"Login\"\r\n\r\n  @launchPage\r\n  Scenario: Validate Login link redirection\r\n    Given User is on SweetBalance homepage\r\n    When User click on the Login link\r\n    Then User should be redirected to the Login page\r\n\r\n  @launchPage\r\n  Scenario: Verify redirection from Check Your Risk button\r\n    Given User is on SweetBalance homepage\r\n    When User click on Check Your Risk button\r\n    Then User should be redirected to the assessment modal dialog\r\n\r\n#--------------------------------------------------------------------------------------------------------\r\n#Feature: Non-Functional Testing - Home Page\r\n\r\n  @launchPage\r\n  Scenario: Homepage loads within acceptable time\r\n    Given User launches the browser\r\n    When User enters the SweetBalance url\r\n    Then Page should be fully loaded within 3 seconds\r\n\r\n  #@launchPage\r\n  #Scenario:  \r\n    #Given User is in browser\r\n    #When User enters the SweetBalance url\r\n    #Then All elements are readable and accessible without horizontal scrolling\r\n#\r\n  #@launchPage\r\n  #Scenario: \r\n    #Given User is in browser\r\n    #When User enters the SweetBalance url\r\n    #Then All major sections are accessible with appropriate labels and alt texts\r\n#\r\n  #@launchPage\r\n  #Scenario: \r\n    #Given User is in browser\r\n    #When User enters the SweetBalance url\r\n    #Then User finds the design visually appealing and readable\r\n#\r\n  #@launchPage\r\n  #Scenario: \r\n    #Given User is in browser\r\n    #When User enters the SweetBalance url\r\n    #Then User can access other sections without scrolling up\r\n#\r\n    #@launchPage\r\n  #Scenario: \r\n    #Given User is in browser\r\n    #When User enters the SweetBalance url\r\n    #Then User has a consistent experience across browsers","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/LaunchPage.feature","feature":{"location":{"line":3,"column":1},"tags":[{"location":{"line":2,"column":1},"name":"@launchPage","id":"21d47c00-a44b-4075-96ed-bc563659aef0"}],"language":"en","keyword":"Feature","name":"Verify Homepage UI components","description":"","children":[{"scenario":{"location":{"line":14,"column":3 n User clicks continue with email button after entering a email as in \"<Sheet>\" and \"<TestcaseID>\"\r\n    #Then User should see <Expected>\r\n#\r\n    #Examples: \r\n      #| TestcaseID | Scenario                            | Expected              | Sheet |\r\n      #| login_01   | email input accepts valid new email | Complete your profile | login |\r\n      #| login_02   | enters an invalid email             | validation error      | login |\r\n\r\n  #@skipLaunch @reguserloginpgfield\r\n  #Scenario Outline: Verify <Scenario>\r\n    #Given User is on login page\r\n    #When Registered user clicks continue with email button after entering valid email\r\n    #Then User should see <Expected>\r\n#\r\n    #Examples: \r\n      #| Scenario                                 | Expected              |\r\n      #| email input accepts valid existing email | password field        |\r\n      #| password field in login page             | Sign in button        |\r\n      #| sub text                                 | email id  in sub text |\r\n      #| presence of forgot password link         | Forgot password link  |\r\n#\r\n  @skipLaunch @pwdplaceholder\r\n  Scenario: Verify presence of placeholder in password field\r\n    Given User is on login page\r\n    When Registered user clicks continue with email button after entering valid email\r\n    Then User should see expected Text as in \"login\" and \"login_04\"\r\n\r\n  @skipLaunch @navhome\r\n  Scenario: Verify password input accepts valid existing user\r\n    Given User is on login page\r\n    When Registered user clicks sign in after entering password\r\n    Then User should be navigted to Home page\r\n#----------------------------------------------------------------------------------------------------------------------------------------------------------\r\n#Feature 3: Complete Profile Form validation for new user- Total: 5\r\n  #@skipLaunch @completeprofileform\r\n  #Scenario Outline: Verify <Scenario> is visible\r\n    #Given User is on login page\r\n    #When User clicks continue with email button after entering a email as in \"login\" and \"login_01\"\r\n    #Then User should see <Expected>\r\n#\r\n    #Examples: \r\n      #| Scenario                    | Expected                       |\r\n      #| Full Name field             | Full Name input field          |\r\n      #| Username field              | Username input field           |\r\n      #| Password field              | Password input field           |\r\n      #| Terms & Conditions checkbox | Terms & Conditions checkbox    |\r\n      #| Create Account button       | Disabled Create Account button |\r\n      #\r\n#----------------------------------------------------------------------------------------------------------------------------------------------------------      \r\n#Feature 4: Profile form verification - Total:6\r\n  #@skipLaunch @createaccountenabled\r\n  #Scenario: Verify Create Account button is enabled after valid input\r\n    #Given User is on complete profile form page after entering email as in \"login\" and \"login_01\"\r\n    #When User checks the Terms & conditions box after filling all fields as in \"login\" and \"login_06\"\r\n    #Then Create Account button should be enabled\r\n\r\n  #@skipLaunch @completeprofileform\r\n  #Scenario Outline: Verify <Scenario>\r\n    #Given User is on complete profile form page after entering email as in \"login\" and \"<TestCaseID>\"\r\n    #When User clicks create account button after filling all fields as in \"login\" and \"<TestCaseID>\"\r\n    #Then User should see \"<Expected>\"\r\n\r\n    #Examples: \r\n      #| TestCaseID | Scenario                                   | Expected                       |\r\n      #| login_07   | Create account form with invalid Fullname  | Fullname error message         |\r\n      #| login_08   | Create account form with invalid UserNmae  | Username error message         |\r\n      #| login_09   | Create account form  with valid data       | upload blood report            |\r\n      #| login_10   | presence of Upload Blood Report button     | upload blood report            |\r\n      #| login_11   | presence of Step Through Onboarding button | Step Through Onboarding button |\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/Login.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@sweet","id":"e7fc77cc-085f-45d7-b489-019f9c2c68d1"},{"location":{"line":1,"column":8},"name":"@login","id":"dd92ac17-4421-4e03-ae26-1e2f1d2b2444"}],"language":"en","keyword":"Feature","name":"Login Page Verification","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on SweetBalance homepage","id":"705b7b64-57cc-4e46-bd3d-cb510b3f0331"}],"id":"340db6f4-25d5-49bb-944f-c09f10dd9dd5"}},{"scenario":{"location":{"line":33,"column":3},"tags":[{"location":{"line":32,"column":3},"name":"@skipLaunch","id":"3c6b472e-dec9-440f-9332-c139759a5057"},{"location":{"line":32,"column":15},"name":"@pwdplaceholder","id":"f22669ba-3c01-47d7-a6f8-57bbf8e1b595"}],"keyword":"Scenario","name":"Verify presence of placeholder in password field","description":"","steps":[{"location":{"line":34,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on login page","id":"ac47f382-e660-41e5-90bc-5b5cbd01dffb"},{"location":{"line":35,"column":5},"keyword":"When ","keywordType":"Action","text":"Registered user clicks continue with email button after entering valid email","id":"0502644a-5b76-4fd6-82d8-c2836c1cadd9"},{"location":{"line":36,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"User should see expected Text as in \"login\" and \"login_04\"","id":"8eb7fc51- "file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/LoginOnboardingScenariosWithBloodReport.feature","data":"@sweet @login_OnboargingScenarioswithreport\r\nFeature: Onboarding Scenarios with blood report\r\n\r\n  @navbloodreportmodal\r\n  Scenario: Verify navigation of blood report modal\r\n    Given User is in upload blood report page\r\n    When User clicks on Upload Blood Report button\r\n   Then User should navigate to blood report modal\r\n  \r\n  @uploadbox\r\n  Scenario: Verify upload box supports drag & drop\r\n    Given User is in upload blood report page\r\n    When User hovers over the upload box\r\n    Then Upload box should show drag & drop interaction\r\n    \r\n \r\n #------------------------------------------\r\n #@uploadboxinvalidfile\r\n  #Scenario: Verify supported file types (PDF)\r\n   #Given User is in upload blood report page with \"login\" and \"login_12\"\r\n   # When User tries to upload a non-PDF file\r\n   # Then User should see \"Only PDF files are supported\" error\r\n    \r\n    #@uploadboxvalidover10MB\r\n  #Scenario: Verify supported file types (PDF)\r\n  # Given User is in upload blood report page with \"login\" and \"login_13\"\r\n   # When User uploads a PDF file over 10MB\r\n    #Then User should see \"File exceeds 10MB\" error\r\n    \r\n    @uploadboxvalidPDF\r\n  Scenario: Verify valid PDF file upload \r\n   Given User is in upload blood report page with \"login\" and \"login_14\"\r\n    When User uploads valid PDF file\r\n    Then User should see processing percentage bar\r\n    \r\n     #@uploadboxcancel\r\n  #Scenario: Verify valid PDF file upload \r\n  # Given User is in upload blood report page\r\n   # When User clicks Cancel\r\n    #Then Modal should be closed and user returned to previous screen\r\n    \r\n   # @uploadboxprocessthefile\r\n  #Scenario: Verify valid PDF file upload \r\n   #Given User is in upload blood report page with \"login\" and \"login_15\"\r\n    #When User uploads valid PDF file\r\n    #Then User should see Report analysis \r\n    \r\n    #@uploadboxreportanalysis\r\n  #Scenario: Verify valid PDF file upload \r\n   #Given User is in upload blood report page with \"login\" and \"login_16\"\r\n    #When User uploads valid PDF file\r\n    #Then User should see onboarding button \r\n    \r\n   #Scenario: Upload report and verify all sections are visible\r\n # Given User is in upload blood report page with \"login\" and \"login_17\"\r\n  #When User uploads valid PDF file\r\n  #Then User should see the following sections:\r\n   # | Blood Test Results     |\r\n    #| Complete Blood Count   |\r\n    #| Medical Conditions     |\r\n    #| Abnormal Values        |\r\n    #| Recommendations        |\r\n\r\n #---------------------------------------------\r\n \r\n  #@skipLaunch @Onboardingformvalidation1\r\n  #Scenario Outline: Verify <Scenario>\r\n    #Given User is in Onboarding Process after clicking Onboarding button\r\n    #Then User should see <Expected>\r\n#\r\n    #Examples: \r\n      #| Scenario                    | Expected                       |\r\n      #| presence of text field             | text field for Age, height , weight          |\r\n      #| presence of dropdown            | dropdown option for Gender field         |\r\n     # | dropdown text for gender              | Male , female, prefer not to say  options in dropdown          |\r\n    # | progress shows 1 of 5 steps              | Step 1 of 5           |\r\n    #|progress bar is visible| Progress Bar |\r\n    #\t| presence of continue button     | enabled Continue button |\r\n    \r\n    \r\n   # @skipLaunch @Onboardingformvalidation2\r\n # Scenario Outline: Verify <Scenario>\r\n  #  Given User is in Onboarding Process after clicking Onboarding button\r\n    #When User enters all \"<valid\/invalid>\" values with \"login\" and \"<TestCaseID>\" and clickd continue\r\n    #Then User should see <Expected> as\r\n\r\n   # Examples: \r\n    #|TestCas ebellion are we dealing with?       |\r\n      | Step1 sub text                     | This will help us tailor your plan to your condition |\r\n      | Progress bar reflects Step 1 of 12 | Step 1 of 12                                         |\r\n      | options are displayed              | Type 2,I don't know                                  |\r\n      | step 1 progress is highlighted     | Step 1 indicator highlighted                         |\r\n\r\n  #-------------------------------------------------------------------------------------------------------------------------------------------------------------\r\n  # Feature 2: Functional scenarios for Step and non functional scenarios for  Step 2\r\n  @OnboardingStepwithoutbloodreportstep1Functional\r\n  Scenario Outline: Verify <Scenario> for step onboarding without blood report\r\n    Given User is in step1 Onboarding form without blood report\r\n    When User selects the \"<condition>\" in step1 onboarding\r\n    Then User should see \"<Expected>\" for step for onboarding without report \"<Scenario>\"\r\n\r\n    Examples: \r\n      | Scenario                           | Expected                            | condition   |\r\n      | option is selectable               | Step 2 of 12                        | I dont know |\r\n      | presence of back button in step 2  | back button in step 2               | I dont know |\r\n      | Step 2 heading is visible          | Which fabulous label fits you best? | I dont know |\r\n      | step 2 sub text                    | Choose your gender                  | I dont know |\r\n      | Progress bar reflects Step 2 of 12 | Step 2 of 12                        | I dont know |\r\n      | gender options                     | Male 👨‍🦱,Female 👩‍🦰,Other ⚧️    | I dont know |\r\n      | step 2 progress is highlighted     | Step 2 indicator highlighted        | I dont know |\r\n\r\n  @OnboardingStepwithoutbloodreportstep1CaptureMsg\r\n  Scenario Outline: Verify message selecting condition in step1\r\n    Given User is in step1 Onboarding form without blood report\r\n    When User selects the \"<condition>\" in step1 onboarding\r\n    Then User should see \"<Expected>\" in step onboarding\r\n\r\n    Examples: \r\n      | Expected                                             | condition   |\r\n      | No worries, we're here to figure it out together! 🔍 | I dont know |\r\n\r\n  #-------------------------------------------------------------------------------------------------------------------------------------------------------------\r\n  # Feature 3: Functional test for Onboarding Step 2 and non functional scenarios for Step 3\r\n  @OnboardingStepwithoutbloodreportstep2Fnlstep3NonFnl\r\n  Scenario Outline: Verify <Scenario> for step onboarding without blood report\r\n    Given User is in step2 Onboarding form without blood report\r\n    When User selects a \"<gender>\" in step3\r\n    Then User should see \"<Expected>\" for step for onboarding without report \"<Scenario>\"\r\n\r\n    Examples: \r\n      | Scenario                           | Expected                       | gender     |\r\n      | option is selectable               | Step 3 of 12                   | Male 👨‍🦱 |\r\n      | Step 3 heading is visible          | Age: own it, pick your number. | Male 👨‍🦱 |\r\n      | step 3 sub text                    | Please select your age         | Male 👨‍🦱 |\r\n      | Progress bar reflects Step 3 of 12 | Step 3 of 12                   | Male 👨‍🦱 |\r\n      | Back button is visible in step 3   | Back button                    | Male 👨‍🦱 |\r\n\r\n  @OnboardingStepwithoutbloodreportstep2Fnlstep3NonFnl2\r\n  Scenario Outline: Verify <Scenario> for step onboarding without blood report\r\n    Given User is in step2 Onboarding form without blood report\r\n    When User selects a \"<gender>\" in step3\r\n    Then User should see \"<Expected>\" for step for onboarding without report \"<Scenario>\" and \"<Suffix>\"\r\n\r\n    Examples: \r\n      | Scenario                       | Expected  | Suffix | gender  |\r\n      | options is displayed in step 3 | 18 to 100 | years  | Male 👨 |\r\n\r\n  @iframescrollable\r\n  Scenario: Verify user should able to scroll the iframe to see options\r\n    Given User is in step2 Onboarding form without blood report\r\n    When User selects a \"Male 👨\" in step3\r\n    Then iframe options should have scroll option\r\n\r\n  @verifybackbuttonstep2\r\n  Scenario Outline: Verify back button function in step2\r\n    Given User is in step2 Onboarding form without blood report\r\n    When User clicks back button in step\r\n    Then User should see \"<Expected>\" for step for onboarding without report \"<Scenario>\"\r\n\r\n    Examples: \r\n      | Scenario       | Expected     |\r\n      | Nav back step2 | Step 1 of 12 |\r\n\r\n  #-------------------------------------------------------------------------------------------------------------------------------------------------------------\r\n  # Feature 4: Functional test for Onboarding Step 3 and non functional scenarios for Step 4\r\n  @Onboardingstep3functional1\r\n  Scenario Outline: Validate notification message for <Scenario>\r\n    Given User is in step3 Onboarding form without blood report\r\n    When User selects age between \"<Scenario>\" in step3 \"<age>\"\r\n    Then User should see \"<Expected>\" in step onboarding\r\n\r\n    Examples: \r\n      | Scenario | Expected                                               | age |\r\n      | 18-29    | Young and ready to conquer! 🚀                         |  25 |\r\n      | 30-49    | In your prime and crushing it! 💫                      |  35 |\r\n      | above 50 | Age is just a number, and you're numbering it well! 🎯 |  70 |\r\n\r\n  @Onboardingstep3functional2\r\n  Scenario Outline: Verify <Scenario> for step onboarding without blood report\r\n    Given User is in step3 Onboarding form without blood report\r\n    When User selects age between \"<Scenario>\" in step3 \"<age>\"\r\n    Then User should see \"<Expected>\" for step for onboarding without report \"<Scenario>\"\r\n\r\n    Examples: \r\n      | Scenario                           | Expected                                | age |\r\n      | option is selectable               | Step 4 of 12                            |  25 |\r\n      | Step 4 heading is visible          | How close are you to the clouds?        |  45 |\r\n      | step 4 sub text                    | Please enter your height                |  45 |\r\n      | Progress bar reflects Step 4 of 12 | Step 4 of 12                            |  45 |\r\n      | Back button is visible in step 4   | Back button should be visible in step 4 |  77 |\r\n\r\n  @2tabstoselectheight\r\n  Scenario: Verify step 4 has 2 tabs to select height\r\n    Given User is in step3 Onboarding form without blood report\r\n    When User selects age between \"<Scenario>\" in step3 \"25\"\r\n    Then following scetions should be visible\r\n      | centimeters     |\r\n      | feet and inches |\r\n\r\n  @Onboardingstep3functional3\r\n  Scenario Outline: Verify <Scenario> in step4\r\n    Given User is in step3 Onboarding form without blood report\r\n    When User selects age between \"<Scenario>\" in step3 \"<age>\"\r\n    Then User should see \"<Expected>\" for step for onboarding without reports \"<Scenario>\"\r\n\r\n    Examples: \r\n      | Scenario          | Expected      | age |\r\n      | first tab height  | Centimeters   |  45 |\r\n      | second tab height | Feet & Inches |  45 |\r\n\r\n  @Onboardingstepvaluescm\r\n  Scenario Outline: Validate <Scenario> values\r\n    Given User is in step3 Onboarding form without blood report\r\n    When User selects age between \"<Scenario>\" in step3 \"<age>\"\r\n    Then User should see \"<Expected>\" for step for onboarding without report \"<Scenario>\" and \"<Suffix>\"\r\n\r\n    Examples: \r\n      | Scenario    | Expected   | Suffix | age |\r\n      | centimeters | 120 to 220 | cm     |  55 |\r\n\r\n  @Onboardingstepvaluesinches\r\n  Scenario: Validate feet and inches values\r\n    Given User is in step3 Onboarding form without blood report\r\n    When User selects age between \"<Scenario>\" in step3 \"55\"\r\n    Then User should see options have \"4'5 to 7'3\"\r\n\r\n  @verifybackbuttonstep3\r\n  Scenario Outline: Verify back button function in step3\r\n    Given User is in step3 Onboarding form without blood report\r\n    When User clicks back button in step\r\n    Then User should see \"<Expected>\" for step for onboarding without report \"<Scenario>\"\r\n\r\n    Examples: \r\n      | Scenario            | Expected     |\r\n      | Nav back from step3 | Step 2 of 12 |\r\n\r\n  #-------------------------------------------------------------------------------------------------------------------------------------------------------------\r\n  # Feature 5: Functional test for Onboarding Step 4 and non functional scenarios for Step 5\r\n  @Onboardingstep4functional1\r\n  Scenario Outline: Validate notification message for <Scenario>\r\n    Given User is in step4 Onboarding form without blood report\r\n    When User selects \"<height>\" in cm between \"<Scenario>\"  in step4\r\n    Then User should see \"<Expected>\" in step onboarding\r\n\r\n    Examples: \r\n      | Scenario    | height | Expected                                                                  |\r\n      | above 180cm |    200 | How's the weather up there? (Sorry, we had to do it once) 🌤️             |\r\n      | below 159cm |    120 | Good things come in smaller packages! 📦                                  |\r\n      | 160-179cm   |    165 | Right in the middle - you can reach shelves AND fit in airplane seats! ✈️ |\r\n\r\n  @Onboardingstep4functional2\r\n  Scenario Outline: Validate <Scenario>\r\n    Given User is in step4 Onboarding form without blood report\r\n    When User selects from \"<options>\" available in step4\r\n    Then User should see \"<Expected>\" for step for onboarding without report \"<Sce 8-aab7-92f0a1599c2e"},{"name":"@loginUI","astNodeId":"12da656a-3dfb-4383-9e6e-b604d3c33c37"},{"name":"@skipLaunch","astNodeId":"b29f44c0-324c-488f-92ef-48fc6adb14e1"},{"name":"@uiverification","astNodeId":"7594e94f-5137-48f0-aaab-d6dbab754ab6"}],"astNodeIds":["81dde3af-cddf-45b5-a71d-429d42f02d61","a7be647b-2415-443c-a774-e8ebb3a53284"]}},{"source":{"uri":"file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/PremiumUserActivityMedicationLog.feature","data":"@sweet @premiumActivityMedicalLog @premiumChristy\r\nFeature: Premium User Logbook page - Physical Activity and Medication Dosage Tracker\r\n\r\n\tBackground: Premium User is in home page after logged in\r\n\t\tGiven The user is in the Home page and clicks Sign In of premium account\r\n    When The user enters valid credentials as in \"premiumUser\" and \"PremiumUser\" and logs in of premium account\r\n    \r\n\t@logBookSection \r\n  Scenario Outline: Verify presence of \"<Scenario>\" section\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see \"<Scenario>\" section of premium account\r\n    \r\n    Examples:\r\n    |Scenario|\r\n    |Physical Activity|\r\n    |Medication Dosage|\r\n \r\n   @logBookScetionTitle \r\n   Scenario Outline: Verify title of \"<Scenario>\" section\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see title \"<Scenario>\" of premium account\r\n    \r\n    Examples:\r\n    |Scenario|\r\n    |Physical Activity|\r\n    |Medication Dosage|\r\n    |Log Review|\r\n    \r\n\t@iconInTitle \r\n \tScenario Outline: Verify the presence of icons beside title \"<Scenario>\"\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see the icons on left side of \"<Scenario>\" title of premium account\r\n    \r\n    Examples:\r\n    |Scenario|\r\n    |Physical Activity Icon|\r\n    |Medication Dosage Icon|\r\n  \r\n  @xAxisValidation\r\n  Scenario Outline: Verify last seven days are displayed on X-axis in \"<Scenario>\"\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see the X-axis display the last seven days ending today for \"<Scenario>\" of premium account\r\n    \r\n    Examples:\r\n    |Scenario|\r\n    |Physical Activity|\r\n\r\n\t@alignment\r\n\tScenario: Verify the alignment of statistic card \"Total calories\",\"Daily Average\",\"Peak day\"\r\n\t  Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see exactly three statistic cards displayed horizontally of premium account\r\n   \r\n   @activityColor\r\n   Scenario Outline: Verify text color of \"<Scenario>\" in Physical Activity section\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see \"<Scenario>\" text colour \"<Rgba>\" of premium account\r\n    \r\n    Examples:\r\n    |Scenario|Color|Rgba|\r\n    |Total Calories|purple|rgba(91, 33, 182, 1)|\r\n    |Daily Average|orange|rgba(146, 64, 14, 1)|\r\n    |Peak Day|red|rgba(159, 18, 57, 1)|    \r\n   \r\n   @yAxisCalories \r\n\tScenario: Verify Y-axis has text calories\r\n\t  Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see y-axis  clearly labeled with the text \"Calories\" of premium account\r\n    \r\n  #Skipfornow  \r\n  #@barChartActivity \r\n\t#Scenario: Verify the display of bars if there is activity log in home page \r\n\t # Given User is in the homepage of premium account\r\n   # When User clicks Logbook button of premium account\r\n   # Then user should see the bars displayed only for days with logged activities of premium account\r\n    \r\n    @yAxisNoOfDose\r\n\tScenario: Verify the Y-axis has text \"Number of Doses\"\r\n\t  Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see the text Number of Doses on Y-axis of premium account\r\n    \r\n\t@colorbarChart\r\n \tScenario Outline: Verify \"<Color>\" colour bar is displayed for \"<Scenario>\" on one week schedule\r\n\t  Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see \"<Rgba>\" colour bar for \"<Scenario>\" of premium account \r\n    \r\n    Examples:\r\n    |Scenario|Color|Rgba|\r\n    |Doses Taken|green|#22c55e|\r\n    |Doses Missed|red|#ef4444|\r\n    \r\n    @logReviewHeader\r\n\tScenario Outline: Verify table header in log review section \r\n\t  Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see table header \"<Scenario>\" of premium account\r\n    \r\n    Examples:\r\n    |Scenario|\r\n    |Date|\r\n    |Blood Glucose|\r\n    |Nutrition|\r\n    |Activity|\r\n    |Medication|\r\n \r\n @7daysLogReview\r\n\tScenario: Verify log review displays last 7 days of date entries including today\r\n\t  Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see date of last seven days including today of premium account\r\n    \r\n@logReviewDateFormat\r\n\tScenario: Verify the display of date format\r\n\t  Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see the date format as \"MMM dd, yyyy\" of premium account\r\n   \r\n  @orderOfDateLog\r\n \tScenario: Verify the order of date \r\n\t  Given User is in the homepage of premium account \r\n    When User clicks Logbook button of premium account\r\n    Then User should see the date ordered in descending order for last seven days including today of premium account\r\n    \r\n   \r\n   #@glucoseLogReview\r\n \t#Scenario: Verify the blood glucose entries in log review section if there is log\r\n\t # Given User log blood glucose value in Home page of premium account\r\n   # When User clicks Logbook button of premium account\r\n   # Then User should see logged value for those days under Blood glucose of premium account\r\n    \r\n    \r\n    #@nutrientLogReview\r\n \t#Scenario: Verify the nutrient value entries in log review section if there is log\r\n\t # Given User log Nutrient value in Home page of premium account\r\n   # When User clicks Logbook button of premium account\r\n   # Then User should see logged value for those days under Nutrient value of premium account\r\n    \r\n    \r\n   # @activityLogReview\r\n \t#Scenario: Verify the physical activity entries in log review section if there is log\r\n\t  #Given User log Physical Activity in home page of premium account\r\n    #When User clicks Logbook button of premium account\r\n    #Then User should see logged value for those days under physical activity of premium account\r\n    \r\n    #@medicationLogReview\r\n# \tScenario: Verify the medication value in log review section if there is log \r\n\t#  Given User log Medication dosage in Home page of premium account\r\n  #  When User clicks Logbook button of premium account\r\n  #  Then User should see logged value for those under Medication Dosage of premium account","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/PremiumUserActivityMedicationLog.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@sweet","id":"ba9e8d7b-ceda-48b4-a9cf-8e1311550a1d"},{"location":{"line":1,"column":8},"name":"@premiumActivityMedicalLog","id":"b4967bb7-1fc0-4b86-b718-8 rio>\" in Excercise page details\r\n    Given User is in the homepage of premium account\r\n    When User clicks the Exercise option from the side panel of premium account\r\n    Then \"<Scenario>\" is displayed in premium account\r\n    \r\n    Examples:\r\n    \t|Scenario|\r\n    \t|ViewFullSchedule|\r\n    \t|WarmUp|\r\n    \t|MainWorkout|\r\n    \t|CoolDown|\r\n    \r\n   @WarmUp\r\n  Scenario Outline: Verify \"<Scenario>\" in Warm Up tab details are displayed\r\n    Given User is in the homepage of premium account\r\n    When User clicks the Exercise option from the side panel of premium account\r\n    Then \"<Scenario>\" is displayed in premium account\r\n    \r\n    Examples:\r\n    \t|Scenario|\r\n    \t|ExerciseName|\r\n    \t|Description|\r\n    \t|Duration|\r\n    \t|Calories|\r\n    \t|IntensityLevel|\r\n    \t\r\n    \t\r\n   @MainWorkout\t\r\n  Scenario Outline: Verify \"<Scenario>\" in Main Workout tab details are displayed\r\n    Given User is in the Exercise section of premium account\r\n    When User clicks the Main Workout Tab of premium account\r\n    Then \"<Scenario>\" is displayed in premium account\r\n    \r\n    Examples:\r\n    \t|Scenario|\r\n    \t|ExerciseName|\r\n    \t|Description|\r\n    \t|Duration|\r\n    \t|Calories|\r\n    \t|IntensityLevel|\r\n    \t\r\n   \t@CoolDown\r\n  Scenario Outline: Verify \"<Scenario>\" in Cool Down tab details are displayed\r\n    Given User is in the Exercise section of premium account\r\n    When User clicks the Cool Down Tab of premium account\r\n    Then \"<Scenario>\" is displayed in premium account\r\n    \r\n    Examples:\r\n    \t|Scenario|\r\n    \t|ExerciseName|\r\n    \t|Description|\r\n    \t|Duration|\r\n    \t|Calories|\r\n    \t|IntensityLevel|\r\n    \t\r\n  @MarkAsCompleted\r\n  Scenario Outline: Verify \"<Scenario>\" is displayed when clicking Mark As Completed button\r\n    Given User is in the Exercise section of premium account\r\n    When User clicks the Mark As Completed button of premium account\r\n    Then \"<Scenario>\" is displayed in premium account\r\n    \r\n    Examples:\r\n    \t|Scenario|\r\n    \t|SuccessDialog|\r\n    \t|Completed|\r\n    \t|UndoOption|\r\n    \t\r\n\t@UndoCompleted\r\n  Scenario: Verify button reverts back after undo\r\n    Given User is in the Exercise section of premium account after completing exercise\r\n    When User clicks Undo after marking Exercise as completed\r\n    Then Button changes back to Mark As Completed in the Exercise section of premium account\r\n \r\n    @TodaysExerciseScedule\r\n  Scenario: Verify navigation to View full schedule\r\n    Given User is in the Exercise section of premium account\r\n    When User clicks the View Full Schedule button of premium account\r\n    Then User should redirect to Exercise schedule of premium account\r\n    \t\r\n   @TodaysExerciseScedule\r\n  Scenario Outline: Verify \"<Scenario>\" is dispalyed in Todays Exercise Schedule page\r\n    Given User is in the Exercise section of premium account\r\n    When User clicks the View Full Schedule button of premium account\r\n    Then \"<Scenario>\" is displayed in premium account\r\n    \r\n    Examples:\r\n    \t|Scenario|\r\n    \t|TodaysExerciseSchedule|\r\n    \t|BacktoHome|\r\n    \t|WarmUpToday|\r\n    \t|WarmUpExerciseName|\r\n    \t|WarmUpDescription|\r\n    \t|WarmUpDuration|\r\n    \t|WarmUpCalories|\r\n    \t|WarmUpIntensityLevel|\r\n    \t|MainWorkoutToday|\r\n    \t|MainExerciseName|\r\n    \t|MainDescription|\r\n    \t|MainDuration|\r\n    \t|MainCalories|\r\n    \t|MainIntensityLevel|\r\n    \t|CoolDownToday|\r\n    \t|CoolDownExerciseName|\r\n    \t|CoolDownDescription|\r\n    \t|CoolDownDuration|\r\n    \t|CoolDownCalories|\r\n    \t|CoolDownIntensityLevel|\r\n    \t|TotalDuration|\r\n    \t\r\n  @ExerciseIntensity\t\r\n  Scenario: Verify the intensity value\r\n    Given User is in the Exercise section of premium account\r\n    When User clicks the View Full Schedule button of premium account\r\n    Then Exercise intensity should low\/medium\/hard of premium account\r\n    \r\n   @WorkourDuration \r\n  Scenario: Verify total duration matches the sum of individual workout durations\r\n    Given User is in the Exercise section of premium account\r\n    When User clicks the View Full Schedule button of premium account\r\n    Then total duration should equal the sum of all individual durations of premium account\r\n    \r\n   @WorkoutCalories\r\n   Scenario: Verify total calories matches the sum of individual workout calories\r\n    Given User is in the Exercise section of premium account\r\n    When User clicks the View Full Schedule button of premium account\r\n    Then total calories should equal the sum of all individual calories of premium account\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/PremiumUserExercise.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@sweet","id":"b3a454d2-5f5b-4f8f-a882-85e19f354e0e"},{"location":{"line":1,"column":8},"name":"@PremiumExercise","id":"9a3a282c-1e8d-4e69-a920-22d48c1268dd"},{"location":{"line":1,"column":25},"name":"@premiumChristy","id":"3767a841-172b-435c-8df1-6df2e7d5b8e4"}],"language":"en","keyword":"Feature","name":"Premium user Exercise Module on Homepage","description":"","children":[{"background":{"location":{"line":4,"column":2},"keyword":"Background","name":"Premium User is in home page after logged in","description":"","steps":[{"location":{"line":5,"column":3},"keyword":"Given ","keywordType":"Context","text":"The user is in the Home page and clicks Sign In of premium account","id":"6c71d360-a574-4de3-b484-3b9ec30ad8fa"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"The user enters valid credentials as in \"premiumUser\" and \"PremiumUser\" and logs in of premium account","id":"2 umUser\" and logs in of premium account\r\n    \r\n\t@logBookSection\r\n  Scenario Outline: Verify presence of \"<Scenario>\" section\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see \"<Scenario>\" section of premium account\r\n    \r\n    Examples:\r\n    |Scenario|\r\n    |Blood Glucose Tracker|\r\n    |Meal & Nutrition|\r\n \r\n   @logBookScetionTitle \r\n   Scenario Outline: Verify title of \"<Scenario>\" section\r\n     Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see title \"<Scenario>\" of premium account\r\n    \r\n    Examples:\r\n    |Scenario|\r\n    |Blood Glucose Tracker|\r\n    |Meal & Nutrition|\r\n\r\n\t@colorCodeGlucose\r\n   Scenario Outline: Verify colour codes for \"<Scenario>\" \r\n     Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see \"<Scenario>\" displayed in \"<Rgba>\" of premium account\r\n    \r\n    Examples:\r\n    |Scenario|Color|Rgba|\r\n    |Fasting|purple|rgba(91, 33, 182, 1)|\r\n    |Pre-Meal|green|rgba(6, 95, 70, 1)|\r\n    |Post-Meal|yellow|rgba(2, 8, 23, 1)|\r\n    |Bedtime|red|rgba(159, 18, 57, 1)|\r\n    \r\n\t@rangeGlucose\r\n   Scenario Outline: Verify \"<Scenario>\" glucose type range displayed\r\n     Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see the range for \"<Scenario>\" be \"<Range>\" of premium account\r\n    \r\n    Examples:\r\n    |Scenario|Range|\r\n    |Fasting|70-100 mg\/dL|\r\n    |Pre-Meal|70-130 mg\/dL|\r\n    |Post-Meal|<180 mg\/dL|\r\n    |Bedtime|100-140 mg\/dL|\r\n    \r\n  Scenario Outline: Verify last seven days are displayed on X-axis in \"<Scenario>\"\r\n   Given User is in the homepage of premium account\r\n   When User clicks Logbook button of premium account\r\n   Then User should see the X-axis display the last seven days ending today for \"<Scenario>\" of premium account\r\n    \r\n   Examples:\r\n   |Scenario|\r\n   |Blood Glucose Tracker|\r\n   |Daily Nutrition Breakdown|\r\n    \r\n  @yAxisGlucose\r\n  Scenario: Verify Y-axis starts at 70 in glucose chart\r\n     Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see Y-axis minimum value  70 in glucose chart\r\n    \r\n    @yAxisGlucose\r\n  Scenario: Verify Y-axis ends at 180 in glucose chart\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see Y-axis Maximum value 180 in glucose chart\r\n    \r\n\t@mealSectionIcon\r\n Scenario: Verify icon for Meal & Nutrition section is displayed\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see Icon  on the left side of Meal & Nutrition title of premium account\r\n\r\n\t@sevenDayMeal\r\n   Scenario: Verify the presence of 7-day aggregate nutrition section in Meal & Nutrition section\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see the section \"7-Day Aggregate Nutrition\" of premium account\r\n    \r\n   @DailyMealSection\r\n   Scenario: Verify the presence of Daily Nutrition breakdown in Meal & Nutrition section\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User should see the section \"Daily Nutrition breakdown\" of premium account\r\n    \r\n    @colorSevenDayMeal\r\n   Scenario Outline: Verify text color of \"<Scenario>\" in 7-day aggregate nutrition section\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account\r\n    Then User sho eMeal Snack By Default |"},{"location":{"line":57,"column":1},"text":"  #| None PreMeal Snack Calorie |"}]}},{"source":{"uri":"file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/PremiumUserLogBookNoData.feature","data":"@sweet @premiumLogNoData @premiumChristy\r\nFeature: Premium User Logbook page with no data\r\n\r\n\tBackground: Premium User is in home page after logged in\r\n\t\tGiven The user is in the Home page and clicks Sign In of premium account\r\n    When The user enters valid credentials as in \"premiumUser\" and \"PremiumUserNoData\" and logs in of premium account\r\n    \r\n  @dailyNoBars \r\nScenario: Verify bar chart behavior when user has not logged any meals\r\n\tGiven User is in the homepage of premium account\r\n  When User clicks Logbook button of premium account\r\n  Then User should see no bars in Daily Nutrition breakdown section of premium account\r\n\r\n@noPieChart\r\nScenario: Verify pie chart is hidden when user has not logged any meals\r\n\tGiven User is in the homepage of premium account\r\n  When User clicks Logbook button of premium account\r\n  Then User should not see any pie chart in seven day aggregate Nutrition section of premium account\r\n  \r\n  @nutritionNodata\r\n    Scenario Outline: Verify \"<Scenario>\" displays 0g and 0%  in Daily nutrition breakdown section when there is no logs\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account \r\n    Then User should see the \"<Scenario>\" displayed \"0g (0%)\" in Daily nutrition\r\n    \r\n    Examples:\r\n    |Scenario|\r\n    |CarbsCard|\r\n    |ProteinCard|\r\n    |FatsCard|\r\n    \r\n    @EmptyChart\r\nScenario Outline: Verify display of empty chart for \"<Scenario>\" log\r\n\tGiven User is in the homepage of premium account\r\n  When User clicks Logbook button of premium account\r\n  Then User should see no bars in the chart for \"<Scenario>\" logs\r\n  \r\n  Examples:\r\n    |Scenario|\r\n    |No Activity|\r\n    |No Medication|\r\n  \r\n  @activityNoValue\r\nScenario Outline: verify the \"<Scenario>\" value for no activity log\r\n\tGiven User is in the homepage of premium account\r\n  When User clicks Logbook button of premium account\r\n  Then User should see \"<Scenario>\" has \"0 cal\" value for no activity\r\n  \r\n   Examples:\r\n    |Scenario|\r\n    |total calories|\r\n    |daily average|\r\n  \r\n  @noPeakDayValue\r\nScenario: Verify the peak day value for no activity log\r\n\tGiven User is in the homepage of premium account\r\n  When User clicks Logbook button of premium account\r\n  Then User should see no value for no activity\r\n  \r\n  @medicationNodata\r\n    Scenario Outline: Verify \"<Scenario>\" will display 0 doses, if no medication is scheduled\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account \r\n    Then User should see \"0 doses\"  value in the \"<Scenario>\" medication statistics\r\n    \r\n    Examples:\r\n    |Scenario|\r\n    |Total scheduled|\r\n    |Doses Taken|\r\n    |Doses Missed|\r\n    \r\n    @medicationColor\r\n  Scenario Outline: Verify text color of \"<Scenario>\" text in Medication Dosage section\r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account \r\n    Then User should see \"<Rgba>\" colour \"<Scenario>\" text in Medication Dosage section\r\n    \r\n    Examples:\r\n    |Scenario|Color|Rgba|\r\n    |Total Sceduled Color|purple|rgba(91, 33, 182, 1)|\r\n    |Doses Taken Color|green|rgba(6, 95, 70, 1)|\r\n    |Doses Missed Color|yellow|rgba(255, 255, 0, 1)|\r\n    \r\n    @noValueLogReview\r\n    Scenario Outline: Verify the \"<Scenario>\" value in log review section if there is no log \r\n    Given User is in the homepage of premium account\r\n    When User clicks Logbook button of premium account \r\n    Then User should see hyphen - for all the days under \"<Scenario>\" in log review section\r\n    \r\n    Examples:\r\n    |Scenario|\r\n    |blood glucose|\r\n    |nutrient|\r\n    |activity|\r\n    |Medication|\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/nithi\/EclipseWorkspace2024\/Team01_Sweet-Debugger\/src\/test\/resources\/features\/PremiumUserLogBookNoData.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@sweet","id":"d813a90f-6f67-42a8-b7e6-0226db2fc5c1"},{"location":{"line":1,"column":8},"name":"@premiumLogNoData","id":"3f082f5e-15cc-471b-b5fa-537737e430fd"},{"location":{"line":1,"column":26},"name":"@premiumChristy","id":"19b50486-c241-406b-ba1c-fc99181cf872"}],"language":"en","keyword":"Feature","name":"Premium User Logbook page with no data","description":"","children":[{"background":{"location":{"line":4,"column":2},"keyword":"Background","name":"Premium User is in home page after logged in","description":"","steps":[{"location":{"line":5,"column":3},"keyword":"Given ","keywordType":"Context","text":"The user is in the Home page and clicks Sign In of premium account","id":"9519d956-4a46-4347-aac1-95494f3d48b5"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"The user enters valid credentials as in \"premiumUser\" and \"PremiumUserNoData\" and logs in of premium account","id":"95821326-d24e-4a25-baa1-0d1f0170a789"}],"id":"2d3c578d-4ca6-4956-9e46-1b827eec75c2"}},{"scenario":{"location":{"line":9,"column":1},"tags":[{"location":{"line":8,"column":3},"name":"@dailyNoBars","id":"039a2f72-8f93-40a5-8454-0cc9834f91be"}],"keyword":"Scenario","name":"Verify bar chart behavior when user has not logged any meals","description":"","steps":[{"location":{"line":10,"column":2},"keyword":"Given ","keywordType":"Context","text":"User is in the homepage of premium account","id":"92b654ba-8dab-4e38-a200-e5df776d9c28"},{"location":{"line":11,"column":3},"keyword":"When ","keywordType
